import { Container } from "react-bootstrap";
import Table from "react-bootstrap/Table";
import "./Display.css";
import * as data from "./public/products.json";

console.log(data[1]);

function Display() {
  return (
    <div className="Display">
      <Container className="Display-main">
        <h1 className="Display-header">Summary</h1>
        <Table hover className="styled-table">
          <thead>
            <tr>
              <th>Name</th>
              <th>Points</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Dom</td>
              <td>6000</td>
            </tr>
            <tr class="active-row">
              <td>Melissa</td>
              <td>5150</td>
            </tr>
          </tbody>
        </Table>
      </Container>
    </div>
  );
}

export default Display;
